import { connect } from "react-redux";

function Examples({ jobs }) {
  console.log(jobs);
  return (
    <div>
      {jobs.map(job => {
        console.log(job);
        return <p>{job.title}</p>;
      })}
    </div>
  );
}

function mapStateToProps(state) {
  const { jobs } = state;
  return { jobs };
}

export default connect(mapStateToProps)(Examples);
